[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "
PREFIX chembl: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?molecule_name ?target ?target_name ?activity_value ?activity_units ?activity_type
WHERE {
  ?activity a chembl:Activity ;
            chembl:hasMolecule ?molecule ;
            chembl:hasAssay ?assay ;
            chembl:standardValue ?activity_value ;
            chembl:standardUnits ?activity_units ;
            chembl:type ?activity_type .

  ?assay chembl:hasTarget ?target .

  ?target a chembl:SingleProtein ;
          chembl:organism <http://identifiers.org/taxonomy/9606> ;
          chembl:prefLabel ?target_name .

  ?molecule chembl:prefLabel ?molecule_name .

  FILTER(?activity_type IN ("IC50", "EC50", "Kd", "Ki"))
  FILTER(?activity_units = "nM")
  FILTER(?activity_value < 1.0)
  FILTER(?activity_value > 0)
}
ORDER BY ?activity_value
LIMIT 100
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "
