[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT DISTINCT ?protein ?proteinName ?geneName
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:annotation ?kinaseAnnotation ;
           up:annotation ?locationAnnotation .

  # Kinase activity
  ?kinaseAnnotation a up:Function_Annotation ;
                    rdfs:comment ?kinaseComment .
  FILTER(CONTAINS(LCASE(?kinaseComment), "kinase"))

  # Nuclear localization
  ?locationAnnotation a up:Subcellular_Location_Annotation ;
                      up:locatedIn ?location .
  ?location rdfs:comment ?locationComment .
  FILTER(CONTAINS(LCASE(?locationComment), "nucleus"))

  # Get protein name
  OPTIONAL { ?protein up:recommendedName ?recName .
             ?recName up:fullName ?proteinName . }

  # Get gene name
  OPTIONAL { ?protein up:encodedBy ?gene .
             ?gene skos:prefLabel ?geneName . }
}
LIMIT 50
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?protein ?proteinName ?geneName
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:classifiedWith ?goMolecular ;
           up:annotation ?locationAnnotation .

  # Kinase activity via GO molecular function
  ?goMolecular rdfs:subClassOf* <http://purl.obolibrary.org/obo/GO_0016301> .

  # Nuclear localization
  ?locationAnnotation a up:Subcellular_Location_Annotation ;
                      up:locatedIn ?location .
  ?location up:partOf* <http://purl.uniprot.org/locations/191> .

  # Get protein name
  OPTIONAL { ?protein up:recommendedName ?recName .
             ?recName up:fullName ?proteinName . }

  # Get gene name
  OPTIONAL { ?protein up:encodedBy ?gene .
             ?gene skos:prefLabel ?geneName . }
}
LIMIT 50
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?protein ?proteinName ?geneName ?keyword1 ?keyword2
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:mnemonic ?mnemonic ;
           up:classifiedWith ?keyword1 ;
           up:classifiedWith ?keyword2 .

  ?keyword1 a up:Keyword ;
            rdfs:label ?label1 .
  FILTER(CONTAINS(LCASE(?label1), "kinase"))

  ?keyword2 a up:Keyword ;
            rdfs:label ?label2 .
  FILTER(CONTAINS(LCASE(?label2), "nucleus"))

  OPTIONAL { ?protein up:recommendedName ?recName .
             ?recName up:fullName ?proteinName . }

  OPTIONAL { ?protein up:encodedBy ?gene .
             ?gene skos:prefLabel ?geneName . }
}
LIMIT 50
"}}, {"name": "mcp__ols__search", "input": {"query": "kinase activity"}}, {"name": "mcp__ols__search", "input": {"query": "nucleus"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
